export default function Headers(){
  return(
    
    <header>
        <a href="https://github.com/ruturaj-gh" className="logo">
          Blog
        </a>
        <nav>
        <Link to="/login">Login</Link>
        
        <a href="/register">Register</a>
          
        </nav>
    </header>
      
  )
}
